vertex.source:
#version 300 es

// Vertex coordinates in object space for the render quad
in vec3 vertexPosition;
in vec3 vertexNormal;
in vec2 vertexTextureCoordinates;

uniform vec3 lightPosition;
uniform bool lightInCamspace;

// Model matrix
uniform mat4 mMatrix;
// View matrix
uniform mat4 vMatrix;
// Projection matrix
uniform mat4 pMatrix;

uniform float canvasWidth;
uniform float canvasHeight;
uniform vec3 cameraPosition;
uniform mat3 cameraRotation;
uniform bool isOrthographicProjection;
uniform float orthographicFOV;
uniform float perspectiveFOV;

out vec2 fragmentTextureCoordinates;
out vec3 origin;
out vec3 dir;

void main() {
    float aspectRatio = canvasWidth/canvasHeight;
    vec3 origin_camSpace, dir_camSpace;
    if (isOrthographicProjection) {
        origin_camSpace = vec3(vertexPosition.x*orthographicFOV*aspectRatio,
                               vertexPosition.y*orthographicFOV,
                               0);
        dir_camSpace = vec3(0, 0, -1);
    }
    else { // perspective projection
        origin_camSpace = vec3(0);
        dir_camSpace = vec3(vertexPosition.x*aspectRatio,
        vertexPosition.y,
        -1.0/tan(radians(perspectiveFOV)));
    }
    origin = cameraPosition + cameraRotation*origin_camSpace;
    dir = normalize(cameraRotation*dir_camSpace);
    gl_Position = vec4(vertexPosition, 1.0);
    fragmentTextureCoordinates = vertexTextureCoordinates;
}

fragment.source:
#version 300 es

// Set high precision for floating-point calculations
precision highp float;

// Input variables from the vertex shader
in vec2 fragmentTextureCoordinates;
in vec3 origin;
in vec3 dir;

// Constants
#define PI 3.14159265897932384626
const float EPSILON = 0.001;
const float MAX_DIST = 1000.0;
const int RAY_DEPTH = 42;

// Uniforms for accessing data from the rendering context
uniform sampler2D textureRendered;
uniform sampler2D texture1; // Dragonball textures
uniform sampler2D texture2; // --
uniform sampler2D texture3; // --
uniform sampler2D texture4; // --
uniform sampler2D texture5; // --
uniform sampler2D texture6; // --
uniform sampler2D texture7; // --

uniform bool lightInCamspace;
uniform mat4 mMatrix;  // Model matrix
uniform mat4 vMatrix;  // View matrix
uniform mat4 pMatrix;  // Projection matrix

// Material properties
vec4 ambient = vec4(0.1, 0.1, 0.1, 1.0);
vec4 specular = vec4(1.0, 1.0, 1.0, 1.0);
float falloff = 0.35;
float k_a = 0.5; // Ambient Coefficient
float k_d = 1.4; // Diffuse Coefficient
float k_s = 0.5; // Specular Coefficient
float s = 500.0;
float shininess = 20.0; // Specular Exponent
float phi = 7500.0; // Light Intensity

// Area light source
const int NUM_OF_LIGHTSOURCES = 24;
vec3 lightPosition[NUM_OF_LIGHTSOURCES];

// Output variable for fragment color
out vec4 fragColor;

// Structs to represent geometric primitives and rays
struct Sphere {
    vec3 centre;
    float radius;
    vec3 colour;
};

struct Plane {
    vec3 point;
    vec3 normal;
    vec3 colour;
};

struct Ray {
    vec3 origin;
    vec3 dir;
};

// Struct to hold intersection information
struct Intersection {
    float t;
    bool hit;
    vec3 position;
    vec3 normal;
    vec3 colour;
};

// Array of spheres and a plane for the scene
Sphere sphere[7];
Plane plane;

// Function to initialize intersection parameters
Intersection initIntersection() {
    Intersection i;
    i.position = vec3(0, 0, 0);
    i.normal = vec3(0, 0, 0);
    i.colour = vec3(0, 0, 0);
    i.hit = false;
    i.t = -1.0;
    return i;
}

bool shadowRay(Intersection intersect);

// Function to initialise area light source for soft shadow effect
void initializeLightPosition(float distribution) {
    lightPosition[0] = vec3(10, 8, 18);
    for (int i = 1; i < NUM_OF_LIGHTSOURCES; i++) {
        lightPosition[i] = lightPosition[i-1] + distribution;
    }
}

// Function to calculate shading at an intersection point
vec3 illumination(const Intersection i, const Ray ray) {
    vec3 lightDirection[NUM_OF_LIGHTSOURCES];
    float distance = 0.0;
    for (int j = 0; j < NUM_OF_LIGHTSOURCES; j++) {
        lightDirection[j] = vec3(0.0, 0.0, 0.0);
        lightDirection[j] += lightPosition[j] - i.position;
        distance += length(lightDirection[j]) / float(NUM_OF_LIGHTSOURCES);
        lightDirection[j] = normalize(lightDirection[j]);
    }
    vec3 ambient_component = k_a * ambient.xyz;
    vec3 diffuse_component = vec3(0, 0, 0);

    for (int j = 0; j < NUM_OF_LIGHTSOURCES; j++) {
        if (!shadowRay(i)) {
            float diffuse_val = k_d * max(dot(i.normal, lightDirection[j]), 0.0);
            diffuse_component += i.colour * diffuse_val / float(NUM_OF_LIGHTSOURCES);
        }
    }
    vec3 reflect = reflect(lightDirection[0], i.normal);
    float specular_val = k_s * pow((max(0.,dot(normalize(ray.dir), reflect))), shininess);
    vec3 specular_component = specular.xyz * specular_val;
    float delta_a = phi / (4.0 * PI * (distance + s));
    return (ambient_component + diffuse_component + specular_component) * delta_a;
}

// Function to compute the intersection point of a ray with an object
vec3 hitPoint(vec3 origin, vec3 direction, float t) {
    return t * direction + origin;
}

// Function to compute the intersection between a ray and a plane
Intersection planeIntersect(Ray ray) {
    Intersection i = initIntersection();
    float d = dot(ray.dir, plane.normal);
    vec3 delta_p = ray.origin - plane.point;
    float t = -1.0 * (dot(plane.normal, delta_p) / d);

    if (t > 0.0 && t < MAX_DIST) {
        i.hit = true;
        i.normal = plane.normal;
        i.position = hitPoint(ray.origin, ray.dir, t);
        i.t = t;
        i.colour = vec3(0.9, 0.9, 0.9);
    }
    return i;
}

// Function to apply texture map on appropriate spheres
vec3 textureStyle(Intersection intersect, vec3 centre) {
    if (centre == vec3(0.0, 0.0, -1.0)) {
        intersect.colour =vec3(texture(texture1, vec2(0.5+asin(intersect.normal.x)/(PI),0.5-asin(intersect.normal.y)/(PI) )));
    }
    else if (centre == vec3(2.0, 0.0, -1.0)) {
        intersect.colour =vec3(texture(texture2, vec2(0.5+asin(intersect.normal.x)/(PI),0.5-asin(intersect.normal.y)/(PI) )));
    }
    else if (centre == vec3(1.0, 1.732, -1.0)) {
        intersect.colour =vec3(texture(texture3, vec2(0.5+asin(intersect.normal.x)/(PI),0.5-asin(intersect.normal.y)/(PI) )));
    }
    else if (centre == vec3(-1.0, 1.732, -1.0)) {
        intersect.colour =vec3(texture(texture4, vec2(0.5+asin(intersect.normal.x)/(PI),0.5-asin(intersect.normal.y)/(PI) )));
    }
    else if (centre == vec3(-2.0, 0.0, -1.0)) {
        intersect.colour =vec3(texture(texture5, vec2(0.5+asin(intersect.normal.x)/(PI),0.5-asin(intersect.normal.y)/(PI) )));
    }
    else if (centre == vec3(-1.0, -1.732, -1.0)) {
        intersect.colour =vec3(texture(texture6, vec2(0.5+asin(intersect.normal.x)/(PI),0.5-asin(intersect.normal.y)/(PI) )));
    }
    else if (centre == vec3(1.0, -1.732, -1.0)) {
        intersect.colour =vec3(texture(texture7, vec2(0.5+asin(intersect.normal.x)/(PI),0.5-asin(intersect.normal.y)/(PI) )));
    }
    else {
        intersect.colour = vec3(0.1, 0.1, 0.1);
    }
    return intersect.colour;
}

// Function to compute the intersection between a ray and a sphere
Intersection sphereIntersect(Ray ray, Sphere s) {
    Intersection intersect = initIntersection();
    vec3 delta_p = ray.origin - s.centre;
    float b = dot(ray.dir, delta_p);    
    float d = pow(dot(ray.dir, delta_p), 2.0) - pow(length(delta_p), 2.0) + (s.radius * s.radius);

    if (d > 0.0) {
        float discriminant = -b - sqrt(d);
        if (discriminant > 0.0){
            intersect.hit = true;
            intersect.position = hitPoint(ray.origin, ray.dir, discriminant);
            intersect.normal = normalize(intersect.position - s.centre);
            intersect.t = discriminant;
            intersect.colour = textureStyle(intersect, s.centre);
        }
    }
    return intersect;
}

// Function to find the intersection of a ray with all spheres
Intersection sphereReflection(Ray ray) {
    Intersection finalIntersection = initIntersection();

    for (int i = 0; i < 7; i++) {
        Intersection currentIntersection = sphereIntersect(ray, sphere[i]);
        if (currentIntersection.hit) {
           if (!finalIntersection.hit || currentIntersection.t < finalIntersection.t) {
               finalIntersection = currentIntersection;
           }
        }
    }
    return finalIntersection;
}

// Function to find the closest intersection between a ray and all objects
Intersection everyIntersection(Ray ray) {
    Intersection sphereIntersection = sphereReflection(ray);
    Intersection planeIntersection = planeIntersect(ray);

    if (!planeIntersection.hit){
        return sphereIntersection;
    } 
    if (!sphereIntersection.hit) {
        return planeIntersection;
    }
    if (planeIntersection.t < sphereIntersection.t) {
        return planeIntersection;
    }
    return sphereIntersection;
}

int seed = 0;
float rng() {
    seed = int(mod(float(seed) * 1364.0 + 626.0, 509.0));
    return 1.0 / (float(seed) / 509.0);
}

// Function to determine if a point is in shadow
bool shadowRay(Intersection intersect) {
    vec3 direction = normalize((lightPosition[0] * rng()) - (intersect.position * rng()));
    Ray shadowRay;
    shadowRay.origin = intersect.position + intersect.normal * EPSILON;
    shadowRay.dir = direction;
    Intersection shadowIntersect = everyIntersection(shadowRay);

    if (shadowIntersect.hit) {
        return true;
    }
    else {
        return false;
    }
}

// Main ray tracing function
vec3 rayTrace(Ray ray) {
    float weight = 1.0;
    vec3 combinedShading = vec3(0.0, 0.0, 0.0);

    for (int i = 0; i < RAY_DEPTH; i++) {
        Intersection intersection = everyIntersection(ray);
        if (!intersection.hit) {
            break;
        }

        combinedShading += illumination(intersection, ray) * weight;
        weight *= falloff;
        vec3 reflectedDirection = normalize(reflect(ray.dir, intersection.normal));
        Ray reflectedRay;
        reflectedRay.origin = intersection.position + intersection.normal * EPSILON;
        reflectedRay.dir = reflectedDirection;
        ray = reflectedRay;
    }
    return combinedShading;
}

// Function to add fog effect
vec3 fog(vec3 colour, float distance) {
    vec3 fogColour = vec3(0.8, 0.35, 0.0);
    float k_fog = 0.2;
    float fogAmount = 1.0 - exp(-distance * k_fog);

    if (distance < 0.0) {
        return fogColour;
    }
    return mix(colour, fogColour, fogAmount);
}

// Main function where rendering occurs
void main() {
    // Define spheres and a plane in the scene
    sphere[0].centre = vec3(2.0, 0.0, -1.0);
    sphere[0].radius = 0.7;
    sphere[0].colour = vec3(1.0, 0.5, 0.0);
    sphere[1].centre = vec3(1.0, 1.732, -1.0);
    sphere[1].radius = 0.7;
    sphere[1].colour = vec3(1.0, 0.5, 0.0);
    sphere[2].centre = vec3(-1.0, 1.732, -1.0);
    sphere[2].radius = 0.7;
    sphere[2].colour = vec3(1.0, 0.5, 0.0);
    sphere[3].centre = vec3(-2.0, 0.0, -1.0);
    sphere[3].radius = 0.7;
    sphere[3].colour = vec3(1.0, 0.5, 0.0);
    sphere[4].centre = vec3(-1.0, -1.732, -1.0);
    sphere[4].radius = 0.7;
    sphere[4].colour = vec3(1.0, 0.5, 0.0);
    sphere[5].centre = vec3(1.0, -1.732, -1.0);
    sphere[5].radius = 0.7;
    sphere[5].colour = vec3(1.0, 0.5, 0.0);
    sphere[6].centre = vec3(0.0, 0.0, -1.0);
    sphere[6].radius = 0.7;
    sphere[6].colour = vec3(1.0, 0.5, 0.0);
    plane.point = vec3(0.0, -3.0, 0.0);
    plane.normal = vec3(0, 1.0, 0);
    plane.colour = vec3(1, 1, 1);
    // scene definition end

    // Compute the direction of the primary ray from the origin and direction vectors provided
    Ray ray;
    ray.origin = origin;
    ray.dir = normalize((mMatrix * vec4(dir, 0.0)).xyz);

    initializeLightPosition(0.1);

    vec3 outputColour = rayTrace(ray);

    Intersection i = everyIntersection(ray);
    float distance = -1.0;
    if (i.hit) {
        distance = length(hitPoint(ray.origin, ray.dir, i.t) - ray.origin);
    }

    // Add fog
    outputColour = fog(outputColour, distance);

    // Trace rays into the scene and compute lighting interactions recursively
    fragColor = vec4(outputColour, 1.0);
}
